import React from "react";
import {ShopContext} from '..shop-context'; 

export default function Product(props) {
  const { product } = props;
  return (
    <div>
      <img className="small" src={product.image} alt={product.name}></img>
      <h3>{product.name}</h3>
      <div>
        <button> Add to cart </button>
      </div>
    </div>
  );
}
